In the kernel, and also in userspace we need a heap. Heap simply is a memory region that we can allocate and deallocate memory from when we need dynamically. Anyway, we need heap implementation for the kernel and userspace. This is achieved in increasing_heap_allocator . This is a crate implementing heap allocator based on "increasing" memory block. What does that mean? It means that this crate require a Page provider, i.e. an entity that can provide pages of memory that reside after each other, and the rest of handling heap memory is done by the crate. This example will make it clear, this is how its implemented in userspace: use increasing_heap_allocator::{PageAllocatorProvider, HeapAllocator}; const PAGE_4K: usize = 4096; struct PageAllocator { heap_start: usize, mapped_pages: usize,
} impl PageAllocator { fn new() -> Self { Self { heap_start: unsafe { syscall::inc_dec_heap(0).unwrap() as usize }, mapped_pages: 0, } }
} impl PageAllocatorProvider<PAGE_4K> for PageAllocator { fn allocate_pages(&mut self, pages: usize) -> Option<*mut u8> { assert!(pages > 0); // calculate the last heap base, using the `heap_start` and `mapped_pages` // the next heap base will be `last_heap_base + (pages * PAGE_4K)` let last_heap_base = self.heap_start + self.mapped_pages * PAGE_4K; let new_addr = unsafe { syscall::inc_dec_heap((pages * PAGE_4K) as isize) }; let Ok(new_addr) = new_addr else { return None; }; // `inc_dec_heap` will return the top of the new block, so it must match where we think the heap ends assert!(new_addr as usize == last_heap_base); // update the mapped pages self.mapped_pages += pages; Some(new_addr) }
} // just a simple usage
fn main() { let allocator = HeapAllocator::new(PageAllocator::new()); let layout = !; // example of layout // allocate and deallocate let ptr = allocator.alloc(layout); allocator.dealloc(ptr, layout);
} The only thing users of this crate need to implement is the PageAllocatorProvider trait, which is a simple trait that requires a method to allocate pages. syscall::inc_dec_heap is very similar to sbrk in Unix, it will increase or decrease the heap size by the given size. An argument of 0 will return the current heap address without changing it, which we use in the beginning to get the initial heap address.

