} else { // no space left, just remove the block from the free list // we need to note the size we took allocation_size = free_block_size; // linked-list logic....
} The add_free_block will add the new free block to the free list, and try to merge it with the free blocks around it. The pre_padding is the allocated_block_offset value, the size is the allocation_size at the end after all the considerations.

