The keyboard driver provide a way to get a blinkcast reader using get_keyboard_reader , where the user can read keyboard events without blocking anytime they want. The console and userspace processes use this reader to read keyboard events. For userspace processes, they can read the keyboard events through the virtual device at /devices/keyboard. A process can open a file descriptor to this device and read from it to get keyboard events. The file descriptor will hold a blinkcast reader to the keyboard driver, then each process can read events without blocking. The user can open the file and read the content, but since we are performing some encoding, its better to use the library emerald_runtime which provide easy way to read the events. Example: use emerald_runtime::keyboard::Keyboard; let mut keyboard = Keyboard::new(); if let Some(key) = keyboard.get_key_event() { println!("Key: {:?}", key);
}
// or
for key in keyboard.iter_keys() { println!("Key: {:?}", key);
}

