This is implemented in fs::mapping The mapping, is a structure we use to map a path prefix to a Filesystem. For example, currently we have the following mappings: '/' -> FAT (filesystem backed by disk)
'/devices' -> Devices (a virtual filesystem) When you open a path, it will find the best mapping, i.e. the longest prefix that matches the path. Then will use the resulting Filesystem manager to open the file. For example, if you open the path /devices/console, it will use the Devices filesystem manager to open the file /console. Internally, this mapping is stored in a recursive tree structure of MappingNode , each will contain: The Filesystem object. Weak ref to parent (to not get into trouble when dropping) childern BTreeMap (child component name -> MappingNode ) So, it will be something like this: - / (root) = { fs: object parent: None children: { "devices": { fs: object parent: / children: {} } }
} This is used so that we can treverse between two mappings easily. i.e., if we are at the beginning of the mapping, and encountered .. path, we can go back to the parent mapping. Also, when going forward in mapping, we can check if the component is a child mapping of this mapping and switch to it easily. With this treversal, we can build canonical path for a node.

